import React, { useEffect } from 'react';

export default function Section9Section() {
  useEffect(() => {
    // Replicate scroll and indicator functionality from original HTML script
    const stepRelative = document.querySelector('.step-relative');
    const stepRelativeHolder = document.querySelector('.step-relative-holdr');
    const stepsIndicator = document.querySelector('.steps-indicator-sm');
    const stepIndicators = stepsIndicator.querySelectorAll('.step-indicator');

    const totalScrollWidth = stepRelativeHolder.offsetWidth - stepRelative.offsetWidth;
    const sectionWidth = totalScrollWidth / (stepIndicators.length - 1);

    const scrollHandler = () => {
      const scrollPosition = stepRelative.scrollLeft;
      const activeIndex = Math.min(
        Math.floor(scrollPosition / sectionWidth),
        stepIndicators.length - 1
      );

      stepIndicators.forEach((indicator, index) => {
        if (index === activeIndex) {
          indicator.classList.add('active');
        } else {
          indicator.classList.remove('active');
        }
      });
    };

    stepRelative.addEventListener('scroll', scrollHandler);

    // Initial scroll positioning
